import { Injectable } from '@angular/core';
import { ThromboseArtereCentralRetine } from '../models/ThromboseArtereCentralRetine';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ThromboseretineService {

  private apiUrl = 'https://localhost:7129/api/ThromboseArtereCentralRetines';

  constructor(private http: HttpClient) { }
  addretine(ThromboseArtereCentralRetine: ThromboseArtereCentralRetine): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ThromboseArtereCentralRetine);

    return this.http.post<any>(`${this.apiUrl}/addretine`, ThromboseArtereCentralRetine, { observe: 'response' });
  }}
